# 1

tot = {}
for g in sp:
	gid = g[0]
	s = 0
	for n in g[1]:
		s += n[1]-n[0]
	if gid in tot:
		tot[gid] += s
	else:
		tot[gid] = s

mg = max(tot.keys(), key=(lambda k: tot[k]))

def max_mins(guard):
	occ = {i: 0 for i in range(60)}
	for g in sp:
		if g[0] == guard:
			for n in g[1]:
				for i in range(n[0], n[1]):
					occ[i] += 1
	m = max(occ.keys(), key=(lambda k:occ[k]))
	return m, occ[m]

ms, o = max_mins(mg)

print("gid: " + str(mg))
print("min: " + str(ms))
print(mg * ms)

